import React, {Component} from 'react';
import './Content.css';

class Content extends Component{
    render(){
        return(
            <div>
                <div className="Content">

                    <p className="title" >The Good Fork</p>
                    <p className="address">West Toronto | 1550 Dundas St W, Toronto, ON M6K 1T5</p>
                </div>
            </div>
        );

    }
}

export default Content
